import React from 'react';
import HeaderItem from './HeaderItem';

const Header = () => {
    return (
        <div className="ui inverted segment">
            <div className="ui inverted menu">
                <HeaderItem 
                    nav="/"
                    name="HOME"
                />
                <div className="right menu">

                </div>

            </div>
        </div>
    );
};

export default Header;
